import React, { useEffect, useState, useRef } from 'react';
import './Modal_edit.css';

export default function PlanModalEdit({ visible, onClose, onEdit, planList, setPlanList, savedLocations }) {

  if (!visible) return null;

  return (
    <div className="modal-overlay" onClick={onClose}>
      <div className="modal" onClick={e => e.stopPropagation()}>
        {/* Header */}
        <div className="modal-header">
          <h2>Edit plan</h2>
          <button className="modal-close" onClick={onClose}>
            ⨉
          </button>
        </div>

        {/* Body */}
        <div className="modal-body">
          <label className="modal-label">Plan List</label>
          <div className="modal-input-group">
            {/* 채워야할 부분 */}
          </div>
        </div>

        {/* Footer */}
        <div className="modal-footer">
          <button className="btn-create" onClick={onEdit}>
            수정
          </button>
        </div>
      </div>
    </div>
  );
}
